import { Modal } from 'antd';

const ScheduleModal = ({visible, onOk, onCancel, filmId, filmTitle}) => {
  return(
    <Modal
      onCancel={onCancel}
      onOk={onOk}
      visible={visible}
      title={filmTitle}
      footer={[]}
    >
      <table>
          <tr>
            <td>1</td>
            <td></td>
          </tr>
        <tr>
          <td>1</td>
        </tr>
        <tr>
          <td>1</td>
        </tr>
        <tr>
          <td>1</td>
        </tr>
      </table>
    </Modal>
  )
}

export default ScheduleModal;
